import classes from "./NavigationBar.module.css"

function NavigationBar(){
    return (
        <ul>
            <li>
                <a href="/groups">Groups</a>
            </li>
            <li>
                <a href="/teachers">Teachers</a>
            </li>
            <li>
                <a href="/Classrooms">classrooms</a>
            </li>
        </ul>
         
    )
}

export default NavigationBar;
